import NavBar from 'components/Navbar'
import { BrowserRouter, Route, Routes } from 'react-router-dom'

// useState

function App () {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route exact path='/' element={<ItemListContainer />} />

      </Routes>
      <ItemListContainer greeting='Aun no hay registros' />
    </BrowserRouter>
  )
}

export default App
